import cart from './icons/cart-icon.svg';
import chat from './icons/chat-icon.svg';
import profile from './icons/profile-icon.svg';
import search from './icons/search-icon.svg';

function NavBar(){
    return (
        <div className="NavBar">
            <span>REELM</span>
            <div className="Icons">
                <span>
                    <img src={search} />
                </span>
                <span>
                    <img src={profile} />
                </span>
                <span>
                    <img src={search} />
                </span>
                <span>
                    <img src={search} />
                </span>
            </div>

        </div>
    )
}

export default NavBar;
